import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { 
  Typography, Button, Card, CardContent, CardActions, 
  CardMedia, Grid, Chip, Box, Dialog, DialogTitle, 
  DialogContent, DialogActions, TextField, Select, MenuItem,
  FormControl, InputLabel
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import FilterListIcon from '@mui/icons-material/FilterList';
import { carService, shopService } from '../services/api';

const CarsPage = ({ newCar, lowMileage }) => {
  const [cars, setCars] = useState([]);
  const [shops, setShops] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [openDialog, setOpenDialog] = useState(false);
  const [currentCar, setCurrentCar] = useState({
    brand: '',
    model: '',
    year: new Date().getFullYear(),
    enginePower: '',
    transmission: 'АКПП',
    condition: 'новая',
    mileage: 0,
    features: '',
    price: '',
    shopId: '',
    inStock: true
  });

  const navigate = useNavigate();

  useEffect(() => {
    loadCars();
    loadShops();
  }, [newCar, lowMileage]);

  const loadCars = async () => {
    setLoading(true);
    try {
      let response;
      if (newCar) {
        response = await carService.getNewCars();
      } else if (lowMileage) {
        response = await carService.getLowMileageCars();
      } else {
        response = await carService.getAllCars();
      }
      setCars(response.data);
    } catch (err) {
      setError('Ошибка при загрузке списка автомобилей');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const loadShops = async () => {
    try {
      const response = await shopService.getAllShops();
      setShops(response.data);
    } catch (err) {
      console.error('Ошибка при загрузке магазинов', err);
    }
  };

  const handleOpenDialog = () => {
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setCurrentCar({
      brand: '',
      model: '',
      year: new Date().getFullYear(),
      enginePower: '',
      transmission: 'АКПП',
      condition: 'новая',
      mileage: 0,
      features: '',
      price: '',
      shopId: '',
      inStock: true
    });
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCurrentCar({
      ...currentCar,
      [name]: value
    });
  };

  const handleSubmit = async () => {
    try {
      const carData = {
        ...currentCar,
        year: parseInt(currentCar.year),
        enginePower: parseInt(currentCar.enginePower),
        price: parseInt(currentCar.price),
        shopId: parseInt(currentCar.shopId),
        mileage: currentCar.condition === 'новая' ? 0 : parseInt(currentCar.mileage)
      };

      await carService.createCar(carData);
      handleCloseDialog();
      loadCars(); // Перезагрузка списка автомобилей
    } catch (err) {
      console.error('Ошибка при добавлении автомобиля', err);
    }
  };

  const getCarImage = (car) => {
    // Заглушка для изображения автомобиля
    return 'https://via.placeholder.com/300x150?text=' + car.brand + '+' + car.model;
  };

  const getTitle = () => {
    if (newCar) {
      return "Новые автомобили";
    } else if (lowMileage) {
      return "Автомобили с пробегом менее 30 000 км";
    }
    return "Список всех автомобилей";
  };

  return (
    <div>
      <Typography variant="h4" component="h1" className="page-title">
        {getTitle()}
      </Typography>

      <div className="action-buttons">
        <Button 
          variant="contained" 
          color="primary" 
          startIcon={<AddIcon />}
          onClick={handleOpenDialog}
        >
          Добавить автомобиль
        </Button>
        
        <Button
          variant="outlined"
          startIcon={<FilterListIcon />}
          sx={{ ml: 1 }}
          onClick={() => navigate('/cars')}
          disabled={!newCar && !lowMileage}
        >
          Все автомобили
        </Button>
        
        <Button
          variant="outlined"
          sx={{ ml: 1 }}
          onClick={() => navigate('/cars/new')}
          disabled={newCar}
        >
          Только новые
        </Button>
        
        <Button
          variant="outlined"
          sx={{ ml: 1 }}
          onClick={() => navigate('/cars/low-mileage')}
          disabled={lowMileage}
        >
          Малый пробег
        </Button>
      </div>

      {loading ? (
        <Typography>Загрузка...</Typography>
      ) : error ? (
        <Typography color="error">{error}</Typography>
      ) : cars.length === 0 ? (
        <Typography>Нет автомобилей для отображения</Typography>
      ) : (
        <div className="card-grid">
          {cars.map((car) => (
            <Card key={car.id} className="card-grid-item">
              <div style={{ display: 'flex', flexDirection: 'column', width: '100%' }}>
                <CardMedia
                  component="img"
                  height="150"
                  image={getCarImage(car)}
                  alt={`${car.brand} ${car.model}`}
                />
                <CardContent sx={{ flexGrow: 1 }}>
                  <Typography variant="h6" component="div">
                    {car.brand} {car.model}
                  </Typography>
                  <Typography variant="body2" color="text.secondary" gutterBottom>
                    {car.year} г., {car.enginePower} л.с., {car.transmission}
                  </Typography>
                  
                  <Box sx={{ mt: 1, mb: 1 }}>
                    {car.condition === 'новая' ? (
                      <Chip label="Новый" color="success" size="small" />
                    ) : (
                      <Chip label={`Пробег: ${car.mileage} км`} color="primary" size="small" />
                    )}
                  </Box>
                  
                  <Typography variant="body1" component="div" sx={{ fontWeight: 'bold', mt: 1 }}>
                    {car.price.toLocaleString()} ₽
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button 
                    size="small" 
                    component={Link} 
                    to={`/cars/${car.id}`}
                  >
                    Подробнее
                  </Button>
                </CardActions>
              </div>
            </Card>
          ))}
        </div>
      )}

      {/* Диалог добавления автомобиля */}
      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="sm" fullWidth>
        <DialogTitle>Добавить новый автомобиль</DialogTitle>
        <DialogContent>
          <Grid container spacing={2} sx={{ mt: 1 }}>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Марка"
                name="brand"
                value={currentCar.brand}
                onChange={handleChange}
                required
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Модель"
                name="model"
                value={currentCar.model}
                onChange={handleChange}
                required
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Год выпуска"
                name="year"
                type="number"
                value={currentCar.year}
                onChange={handleChange}
                required
                InputProps={{ inputProps: { min: 1900, max: new Date().getFullYear() } }}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Мощность двигателя (л.с.)"
                name="enginePower"
                type="number"
                value={currentCar.enginePower}
                onChange={handleChange}
                required
                InputProps={{ inputProps: { min: 1 } }}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <FormControl fullWidth>
                <InputLabel>Коробка передач</InputLabel>
                <Select
                  name="transmission"
                  value={currentCar.transmission}
                  onChange={handleChange}
                  label="Коробка передач"
                  required
                >
                  <MenuItem value="АКПП">АКПП</MenuItem>
                  <MenuItem value="МКПП">МКПП</MenuItem>
                  <MenuItem value="Робот">Робот</MenuItem>
                  <MenuItem value="Вариатор">Вариатор</MenuItem>
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12} sm={6}>
              <FormControl fullWidth>
                <InputLabel>Состояние</InputLabel>
                <Select
                  name="condition"
                  value={currentCar.condition}
                  onChange={handleChange}
                  label="Состояние"
                  required
                >
                  <MenuItem value="новая">Новая</MenuItem>
                  <MenuItem value="с пробегом">С пробегом</MenuItem>
                </Select>
              </FormControl>
            </Grid>
            {currentCar.condition === 'с пробегом' && (
              <Grid item xs={12} sm={6}>
                <TextField
                  fullWidth
                  label="Пробег (км)"
                  name="mileage"
                  type="number"
                  value={currentCar.mileage}
                  onChange={handleChange}
                  required
                  InputProps={{ inputProps: { min: 0 } }}
                />
              </Grid>
            )}
            <Grid item xs={12}>
              <TextField
                fullWidth
                label="Особенности"
                name="features"
                value={currentCar.features}
                onChange={handleChange}
                multiline
                rows={2}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                fullWidth
                label="Цена (₽)"
                name="price"
                type="number"
                value={currentCar.price}
                onChange={handleChange}
                required
                InputProps={{ inputProps: { min: 0 } }}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <FormControl fullWidth>
                <InputLabel>Магазин</InputLabel>
                <Select
                  name="shopId"
                  value={currentCar.shopId}
                  onChange={handleChange}
                  label="Магазин"
                  required
                >
                  {shops.map((shop) => (
                    <MenuItem key={shop.id} value={shop.id}>
                      {shop.name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12}>
              <FormControl fullWidth>
                <InputLabel>В наличии</InputLabel>
                <Select
                  name="inStock"
                  value={currentCar.inStock}
                  onChange={handleChange}
                  label="В наличии"
                  required
                >
                  <MenuItem value={true}>В наличии</MenuItem>
                  <MenuItem value={false}>На комиссии</MenuItem>
                </Select>
              </FormControl>
            </Grid>
          </Grid>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Отмена</Button>
          <Button onClick={handleSubmit} variant="contained" color="primary">
            Добавить
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default CarsPage;
